import React, { useState } from "react";
import MapContainer from "./MapContainer";

const SearchPlace = () => {
  const [place, setPlace] = useState("");

  const onChange = (e) => {
    setPlace(e.target.value);
  };

  return (
    <>
      <MapContainer searchPlace={place} />
      <input
        type="radio"
        name="searchKeyword"
        onClick={onChange}
        value="심리상담소"
      />
      심리상담소
      <input
        type="radio"
        name="searchKeyword"
        onClick={onChange}
        value="정신건강의학과"
      />
      정신의학과
    </>
  );
};

export default SearchPlace;
